import './App.css'
import React from 'react'
import Navbar from './components/Navbar'
import Home from 'pages/home'
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';


function App() {
    return (
        <Router>Hola
            <Navbar />
            <Routes>
                <Route path="/" element={Home}/>
            </Routes>
        </Router>
    )
}

export default App
